settings.cellContentFunction:
if (value || value === 0) {
    const tankCapacity = entity.tankCapacity;
    const tankCapacityOutput = entity.tankCapacityOutput ? entity.tankCapacityOutput : "L";
    let fontWeight = '400';
    let background = '234, 235, 255, 1';
    let progress = '183, 185, 248 , 1';
    let textColor = '';

    if (entity.isLowFuel) {
        background = '209, 39, 48, 0.06';
        progress = '209, 39, 48, 1';
        fontWeight = '500';
        textColor = '#D12730';
    }

    const calculatedValue = (value * tankCapacity) / 100;
    const percent = value + '%';
    const valueText = `${parseFloat(value).toFixed(0)}% (${parseFloat(calculatedValue).toFixed(0)}${tankCapacityOutput})`;

return '<div style="display: flex; justify-content: space-between; align-items: center; margin-right: 10%; min-width: 90px;">' + 
           '<span style="padding: 4px; font-weight: ' + fontWeight +';color: ' + textColor + ';">' + valueText + '</span>' + 
           '<div style="width: 100%; max-width: 100px; height: 16px; background: linear-gradient(to right, rgba(' + progress + ') ' + percent + ', rgba(' + background + ') '+ percent + '); border-radius: 5.21053px;">' + 
           '</div>' + 
        '</div>';
} else {
    return 'N/A';
}

settings.cellStyleFunction:
const showCriticalValue =  entity.isLowTemperature || entity.isHighTemperature;

return {
  "color": showCriticalValue ? "#D12730" : "#4B535B",
  "font-weight": showCriticalValue ? 500 : 400
};

const showCriticalValue = entity.isLowBattery;

return {
  "color": showCriticalValue ? "#D12730" : "#4B535B",
  "font-weight": showCriticalValue ? 500 : 400
};

