    function convertInput(value) {
        const tankDimensionUnits = vm.editEntityFormGroup.get('details').get('tankDimensionUnits').value;
        switch (tankDimensionUnits) {
            case imperial.dimension.inches:
                return value * 2.54;
            case imperial.dimension.feets:
                return value * 30.48
            case metric.dimension.milimeters:
                return value / 10;
            case metric.dimension.centimeters:
                return value;
            case metric.dimension.meters:
                return value * 100;
        }

        return value;
    }

    function convertOutput(value) {
        const tankCapacityOutput = vm.editEntityFormGroup.get('details').get('tankCapacityOutput').value;
        const tankDimensionUnits = vm.editEntityFormGroup.get('details').get('tankDimensionUnits').value;
        if (tankDimensionUnits && value && value > 0) {
            switch (tankCapacityOutput) {
                case imperial.output.gallons:
                    return value * 0.264172;
                case imperial.output.cubicIn:
                    return value * 61.0237;
                case imperial.output.cubicFt:
                    return value * 0.0353147;
                case metric.output.liters:
                    return value;
                case metric.output.cubicMm:
                    return value * 1000000;
                case metric.output.cubicCm:
                    return value * 1000;
                case metric.output.cubicM:
                    return value * 0.001;
            }
        }

        return 0;
    }

    function convertRectangleOutput(h, l, w) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        h = convertInput(h);
        l = convertInput(l);
        w = convertInput(w);

        capacity = convertOutput(((h * l * w) / 1000)).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertVCylinderOutput(h, d) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        h = convertInput(h);
        d = convertInput(d);

        capacity = convertOutput(((Math.PI * Math.pow((d / 2), 2) * h) / 1000)).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertHCylinderOutput(l, d) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        l = convertInput(l);
        d = convertInput(d);

        capacity = convertOutput(((Math.PI * Math.pow((d / 2), 2) * l) / 1000)).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertHOvalOutput(h, l, w) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        h = convertInput(h);
        l = convertInput(l);
        w = convertInput(w);

        capacity = convertOutput((((Math.PI * Math.pow(h / 2, 2)) + (2 * (h / 2) * (w - h))) * l) / 1000).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertVOvalOutput(h, l, w) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        h = convertInput(h);
        l = convertInput(l);
        w = convertInput(w);

        capacity = convertOutput((((Math.PI * Math.pow(w / 2, 2)) + (2 * (w  /2) * (h - w))) * l) / 1000).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertHCapsuleOutput(l, d) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        l = convertInput(l);
        d = convertInput(d);

        capacity = convertOutput((Math.PI * Math.pow(d / 2, 2) * ((4 / 3) * (d / 2) + l)) / 1000).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertVCapsuleOutput(l, d) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        l = convertInput(l);
        d = convertInput(d);

        capacity = convertOutput((Math.PI * Math.pow(d / 2, 2) * ((4 / 3) * (d / 2) + l)) / 1000).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertHEllipticalOutput(l, d) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        l = convertInput(l);
        d = convertInput(d);

        var Ec = Math.PI * Math.pow(d, 3) / 24 * 2;
        capacity = convertOutput((Math.PI * Math.pow(d / 2, 2) * l + Ec) / 1000).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function convertHEllipseOutput(h, l, w) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        h = convertInput(h);
        l = convertInput(l);
        w = convertInput(w);

        capacity = convertOutput((Math.PI * h * w * l / 4) / 1000).toFixed(2);
        tankCapacityControl.setValue(capacity);
    }

    function recalculateTankCapacity() {
        const tankShape = vm.editEntityFormGroup.get('details').get('tankShape').value;
        const sizeMeasureGroup = vm.editEntityFormGroup.get('details').get('sizeMeasure');
        let l, d, h, w;
        switch (tankShape) {
            case vm.tankShapes.hCylinder:
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertHCylinderOutput(l,d);
                break;

            case vm.tankShapes.vCylinder:
                h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertVCylinderOutput(h,d);
                break;

            case vm.tankShapes.rectangle:
                h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                convertRectangleOutput(h,l,w);
                break;

            case vm.tankShapes.hOval:
                h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                if (w && l && w && w > h) {
                    convertHOvalOutput(h,l,w);
                }
                break;

            case vm.tankShapes.vOval:
                h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                if (w && l && w && h > w) {
                    convertVOvalOutput(h,l,w);
                }
                break;

            case vm.tankShapes.hCapsule:
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertHCapsuleOutput(l,d);
                break;
            case vm.tankShapes.vCapsule:
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertVCapsuleOutput(l,d);
                break;    

            case vm.tankShapes.hElliptical:
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertHEllipticalOutput(l,d);
                break;   

            case vm.tankShapes.hEllipse:
                h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                convertHEllipseOutput(h,l,w);
                break;
        }
    }

