    function saveAttributes(entityId) {
        vm.editEntityFormGroup.get('details').get('tankCapacity').enable();
        const details = vm.editEntityFormGroup.get('details').value;

        let attributesArray = [];

        for (let key in details) {
            if (details[key] !== vm.attributes[key]) {
                attributesArray.push({key: key, value: details[key]});
            }
        }

        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        }
        return widgetContext.rxjs.of([]);
    }

