function openEditEntityDialog() {
    customDialog.customDialog(htmlTemplate, EditEntityDialogController).subscribe();
}

function EditEntityDialogController(instance) {
    let vm = instance;
    let subscriptions = [];
    let dimensionChanges = [];

    vm.widgetContext = widgetContext;
    vm.currentStep = 0;
    vm.entityId = null;
    vm.entityName = '';
    vm.entityLabel = '';
    vm.units = metric.dimension.centimeters;
    vm.levelMeasurements = levelMeasurements;

    vm.tankShapes = {
        hCylinder: "Horizontal Cylinder",
        vCylinder: "Vertical Cylinder",
        rectangle: "Rectangle",
        hOval: "Horizontal Oval",
        vOval: "Vertical Oval",
        hCapsule: "Horizontal Capsule",
        vCapsule: "Vertical Capsule",
        hElliptical: "Horizontal 2:1 Elliptical",
        hEllipse: "Horizontal Ellipse"
    };

    vm.attributes = {
        alarmFilter: "noAlarms offline"
    };

    vm.measurementSystems = {
        metric: "Metric",
        imperial: "Imperial"
    };

    vm.liqTypes = {
        gasoline1: "Gasoline regular (87 octane)",
        gasoline2: "Gasoline mid-grade (89 octane)",
        gasoline3: "Gasoline premium (91-93 octane)",
        diesel: "Diesel",
        flexFuel: "Flex Fuel (E85)",
        biodiesel1: "Biodiesel B5 (5%)",
        biodiesel2: "Biodiesel B20 (20%)",
        propane: "Propane (LPG)"
    };

    vm.dimensionUnits = metric.dimension;
    vm.capacityOutputs = metric.output;
    vm.readingUnits = metric.dimension;

    vm.entity = {};

    vm.editEntityFormGroup = vm.fb.group({
        general: vm.fb.group({
            entityName: ['', [vm.validators.required]],
            entityLabel: ['', [vm.validators.required]],
        }),
        details: vm.fb.group({
            liquidType: ['', [vm.validators.required]],
            tankShape: ['', [vm.validators.required]],
            tankCapacity: ['', [vm.validators.min(0)]],
            sizeMeasure: vm.fb.group({
            }),
            tankMeasurementSystem: [vm.measurementSystems.metric, [vm.validators.required]],
            tankDimensionUnits: [metric.dimension.centimeters, [vm.validators.required]],
            tankCapacityOutput: [metric.output.liters, [vm.validators.required]],
            sensorMeasurementSystem: [vm.measurementSystems.metric, [vm.validators.required]],
            sensorDimensionUnits: [metric.dimension.milimeters, [vm.validators.required]],
            levelMeasurement: [null, [vm.validators.required]]
        }),
        location: vm.fb.group({
            latitude: [null, []],
            longitude: [null, []]
        })
    });

    vm.editEntityFormGroup.get('details').get('tankCapacity').disable();

    subscribeForControlsChanges();

    vm.cancel = function() {
        let obs;
        if (vm.entityId) {
            obs = deviceService.deleteDevice(vm.entityId.id);
        } else {
            obs = widgetContext.rxjs.of(null);
        }
        obs.subscribe(() => {
            widgetContext.updateAliases();
            subscriptions.forEach(sub => sub.unsubscribe());
            dimensionChanges.forEach(sub => sub.unsubscribe());
            vm.dialogRef.close(null);
        });
    };

    vm.save = function(next) {
        vm.editEntityFormGroup.markAsPristine();
        let obs;
        if (!next) {
            obs = updateEntity();
        } else {
            obs = saveEntity();
        }
        obs.subscribe(
            function (data) {
                if (data) {
                    vm.entityId = data.id;
                    vm.entity = data;
                    vm.entityName = data.name;
                }

                const details = vm.editEntityFormGroup.get('details').value;
                const location = vm.editEntityFormGroup.get('location').value;

                saveAttributes(vm.entityId).subscribe((data) => {
                    vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                    for (let key in details) {
                        vm.attributes[key] = details[key];
                    }

                    for (let key in location) {
                        vm.attributes[key] = location[key];
                    }

                    if (!next) {
                        subscriptions.forEach(sub => sub.unsubscribe());
                        dimensionChanges.forEach(sub => sub.unsubscribe());
                        widgetContext.updateAliases();
                        vm.dialogRef.close(null);
                    }
                });
            }
        );
    };

    vm.showDimensions = function(dimensionsString) {
        const currentShape = vm.editEntityFormGroup.get('details').get('tankShape').value;
        switch (dimensionsString) {
            case "L_D": 
                return currentShape === vm.tankShapes.hCylinder ||
                       currentShape === vm.tankShapes.vCapsule || 
                       currentShape === vm.tankShapes.hCapsule || 
                       currentShape === vm.tankShapes.hElliptical;

            case "H_D": 
                return currentShape === vm.tankShapes.vCylinder;

            case "W_L_H":
                return currentShape === vm.tankShapes.rectangle || 
                       currentShape === vm.tankShapes.hOval || 
                       currentShape === vm.tankShapes.vOval ||
                       currentShape === vm.tankShapes.hEllipse;
        }
    }

    vm.onStepChange = function(event) {
        if (!vm.entityId && event.selectedIndex === 2) {
            vm.save(true);
            setTimeout(function() {
                subscribeForLocation();
            }, 1000);
        }
    }

    function subscribeForControlsChanges() {
        const tankShapeChange = vm.editEntityFormGroup.get('details').get('tankShape').valueChanges.subscribe((value) => {
            vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
            vm.tankImage = tankImagesMap[value];
            setSizeMeasureFields(value);
        });
        subscriptions.push(tankShapeChange);

        const tankMeasurementSystemChange = vm.editEntityFormGroup.get('details').get('tankMeasurementSystem').valueChanges.subscribe((value) => {
            if (value === vm.measurementSystems.imperial) {
                vm.dimensionUnits = imperial.dimension;
                vm.capacityOutputs = imperial.output;
            } else {
                vm.dimensionUnits = metric.dimension;
                vm.capacityOutputs = metric.output;
            }

            vm.units = "";
            vm.editEntityFormGroup.get('details').get('tankDimensionUnits').setValue(null);
            vm.editEntityFormGroup.get('details').get('tankDimensionUnits').markAsTouched({ onlySelf: true });
            vm.editEntityFormGroup.get('details').get('tankCapacityOutput').setValue(null)
            vm.editEntityFormGroup.get('details').get('tankCapacityOutput').markAsTouched({ onlySelf: true });
            vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
        });
        subscriptions.push(tankMeasurementSystemChange);

        const sensorMeasurementSystemChange = vm.editEntityFormGroup.get('details').get('sensorMeasurementSystem').valueChanges.subscribe((value) => {
            if (value === vm.measurementSystems.imperial) {
                vm.readingUnits = imperial.dimension;
            } else {
                vm.readingUnits = metric.dimension;
            }

            vm.editEntityFormGroup.get('details').get('sensorDimensionUnits').setValue(null);
            vm.editEntityFormGroup.get('details').get('sensorDimensionUnits').markAsTouched({ onlySelf: true });
        });
        subscriptions.push(sensorMeasurementSystemChange);

        const tankDimensionUnitsChange = vm.editEntityFormGroup.get('details').get('tankDimensionUnits').valueChanges.subscribe((value) => {
            vm.units = value;
            setTimeout(() => {
              recalculateTankCapacity(); 
            }, 100);
        });
        subscriptions.push(tankDimensionUnitsChange);

        const tankCapacityOutputChange = vm.editEntityFormGroup.get('details').get('tankCapacityOutput').valueChanges.subscribe((value) => {
            setTimeout(() => {
                recalculateTankCapacity();
            }, 100);
        });

        const levelMeasurementChange = vm.editEntityFormGroup.get('details').get('levelMeasurement').valueChanges.subscribe((value) => {
            if (value === levelMeasurements.empty) {
                vm.editEntityFormGroup.get('details').addControl('sensorGap', vm.fb.control(null, [vm.validators.required, vm.validators.min(0), vm.validators.max(999)]));
            } else {
                try {
                    vm.editEntityFormGroup.get('details').removeControl('sensorGap');
                } catch(e) {}
            }
        });
        subscriptions.push(levelMeasurementChange);
    }

    function setSizeMeasureFields(tankShape) {
        let length = null;
        let diameter = null;
        let height = null;
        let width = null;
        const sizeMeasureGroup = vm.editEntityFormGroup.get('details').get('sizeMeasure');

        // Object.keys(sizeMeasureGroup.controls).forEach(key => {
        //   sizeMeasureGroup.removeControl(key);
        // });

        dimensionChanges.forEach(sub => sub.unsubscribe());

        sizeMeasureGroup.reset();

        switch (tankShape) {
            case vm.tankShapes.hCylinder:
                if (vm.attributes.sizeMeasure) {
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    diameter = vm.attributes.sizeMeasure['diameter'] ? vm.attributes.sizeMeasure['diameter'] : null;
                }

                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('diameter', vm.fb.control(diameter, [vm.validators.required, vm.validators.min(0.001)]));
                // vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
                // vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                subscribeForHCylinder(sizeMeasureGroup);
                break;

            case vm.tankShapes.vCylinder:
                if (vm.attributes.sizeMeasure) {
                    height = vm.attributes.sizeMeasure['height'] ? vm.attributes.sizeMeasure['height'] : null;
                    diameter = vm.attributes.sizeMeasure['diameter'] ? vm.attributes.sizeMeasure['diameter'] : null;
                }

                sizeMeasureGroup.addControl('height', vm.fb.control(height, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('diameter', vm.fb.control(diameter, [vm.validators.required, vm.validators.min(0.001)]));
                // vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
                // vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                subscribeForVCylinder(sizeMeasureGroup);
                break;

            case vm.tankShapes.rectangle:
                if (vm.attributes.sizeMeasure) {
                    height = vm.attributes.sizeMeasure['height'] ? vm.attributes.sizeMeasure['height'] : null;
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    width = vm.attributes.sizeMeasure['width'] ? vm.attributes.sizeMeasure['width'] : null;
                }

                sizeMeasureGroup.addControl('height', vm.fb.control(height, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('width', vm.fb.control(width, [vm.validators.required, vm.validators.min(0.001)]));
                // vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
                // vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                subscribeForRectangle(sizeMeasureGroup);
                break;

            case vm.tankShapes.hOval:
                // w>h must always be true
                if (vm.attributes.sizeMeasure) {
                    height = vm.attributes.sizeMeasure['height'] ? vm.attributes.sizeMeasure['height'] : null;
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    width = vm.attributes.sizeMeasure['width'] ? vm.attributes.sizeMeasure['width'] : null;
                }

                sizeMeasureGroup.addControl('height', vm.fb.control(height, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('width', vm.fb.control(width, [vm.validators.required, vm.validators.min(0.001)]));
                // sizeMeasureGroup.get('width').markAsTouched({ onlySelf: true });
                // sizeMeasureGroup.get('height').markAsTouched({ onlySelf: true });
                subscribeForHOval(sizeMeasureGroup);
                break;

            case vm.tankShapes.vOval:
                // h>w must always be true
                if (vm.attributes.sizeMeasure) {
                    height = vm.attributes.sizeMeasure['height'] ? vm.attributes.sizeMeasure['height'] : null;
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    width = vm.attributes.sizeMeasure['width'] ? vm.attributes.sizeMeasure['width'] : null;
                }

                sizeMeasureGroup.addControl('height', vm.fb.control(height, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('width', vm.fb.control(width, [vm.validators.required, vm.validators.min(0.001)]));
                // sizeMeasureGroup.get('width').markAsTouched({ onlySelf: true });
                // sizeMeasureGroup.get('height').markAsTouched({ onlySelf: true });
                subscribeForVOval(sizeMeasureGroup);
                break;

            case vm.tankShapes.hCapsule:
                if (vm.attributes.sizeMeasure) {
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    diameter = vm.attributes.sizeMeasure['diameter'] ? vm.attributes.sizeMeasure['diameter'] : null;
                }

                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('diameter', vm.fb.control(diameter, [vm.validators.required, vm.validators.min(0.001)]));
                // vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
                // vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                subscribeForHCapsule(sizeMeasureGroup);
                break;

            case vm.tankShapes.vCapsule:
                if (vm.attributes.sizeMeasure) {
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    diameter = vm.attributes.sizeMeasure['diameter'] ? vm.attributes.sizeMeasure['diameter'] : null;
                }

                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('diameter', vm.fb.control(diameter, [vm.validators.required, vm.validators.min(0.001)]));
                // vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
                // vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                subscribeForVCapsule(sizeMeasureGroup);
                break;

            case vm.tankShapes.hElliptical: 
                if (vm.attributes.sizeMeasure) {
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    diameter = vm.attributes.sizeMeasure['diameter'] ? vm.attributes.sizeMeasure['diameter'] : null;
                }

                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('diameter', vm.fb.control(diameter, [vm.validators.required, vm.validators.min(0.001)]));
                // vm.editEntityFormGroup.get('details').get('tankCapacity').setValue(0);
                // vm.editEntityFormGroup.get('details').get('tankCapacity').disable();
                subscribeForHElliptical(sizeMeasureGroup);// :D subscribeForHEll
                break;

            case vm.tankShapes.hEllipse: 
                if (vm.attributes.sizeMeasure) {
                    height = vm.attributes.sizeMeasure['height'] ? vm.attributes.sizeMeasure['height'] : null;
                    length = vm.attributes.sizeMeasure['length'] ? vm.attributes.sizeMeasure['length'] : null;
                    width = vm.attributes.sizeMeasure['width'] ? vm.attributes.sizeMeasure['width'] : null;
                }

                sizeMeasureGroup.addControl('height', vm.fb.control(height, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('length', vm.fb.control(length, [vm.validators.required, vm.validators.min(0.001)]));
                sizeMeasureGroup.addControl('width', vm.fb.control(width, [vm.validators.required, vm.validators.min(0.001)]));
                subscribeForHEllipse(sizeMeasureGroup);// :D subscribeForHEll
        }
    }

    function subscribeForHCylinder(sizeMeasureGroup) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        setTimeout(() => {
            const lengthChange = sizeMeasureGroup.get('length').valueChanges.subscribe((value) => {
                let l = value;
                let d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertHCylinderOutput(l,d);
            });

            dimensionChanges.push(lengthChange);

            // sizeMeasureGroup.get('length').updateValueAndValidity();

            const diameterChange = sizeMeasureGroup.get('diameter').valueChanges.subscribe((value) => {
                let l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                let d = value;

                convertHCylinderOutput(l,d);
            });

            dimensionChanges.push(diameterChange);

            // sizeMeasureGroup.get('diameter').updateValueAndValidity();

            // Merge is not working due to unknown obs type
            // widgetContext.rxjs.merge(
            //     sizeMeasureGroup.get('length').valueChanges,
            //     sizeMeasureGroup.get('diameter').valueChanges
            // ).subscribe(() => {
            //     const l = sizeMeasureGroup.value['length'];
            //     const d = sizeMeasureGroup.value['diameter'];

            //     capacity = ((Math.PI / 4) * Math.pow((d / 2), 2) * l) / 1000;
            //     tankCapacityControl.setValue(capacity);
            // });
        }, 100);
    }

    function subscribeForVCylinder(sizeMeasureGroup) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        setTimeout(() => {
            const heightChange = sizeMeasureGroup.get('height').valueChanges.subscribe((value) => {
                let h = value;
                let d = sizeMeasureGroup.value['diameter'] ? sizeMeasureGroup.value['diameter'] : 0;

                convertVCylinderOutput(h,d);
            });

            dimensionChanges.push(heightChange);

            // sizeMeasureGroup.get('height').updateValueAndValidity();

            const diameterChange = sizeMeasureGroup.get('diameter').valueChanges.subscribe((value) => {
                let h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                let d = value;

                convertVCylinderOutput(h,d);
            });

            dimensionChanges.push(diameterChange);

            // sizeMeasureGroup.get('diameter').updateValueAndValidity();
        }, 100)
    }

    function subscribeForRectangle(sizeMeasureGroup) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        setTimeout(() => {
            const heightChange = sizeMeasureGroup.get('height').valueChanges.subscribe((value) => {
                let h = value;
                let l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                let w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                convertRectangleOutput(h,l,w);
            });

            dimensionChanges.push(heightChange);

            // sizeMeasureGroup.get('height').updateValueAndValidity();

            const lengthChange = sizeMeasureGroup.get('length').valueChanges.subscribe((value) => {
                let h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                let l = value;
                let w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                convertRectangleOutput(h,l,w);
            });

            dimensionChanges.push(lengthChange);

            // sizeMeasureGroup.get('length').updateValueAndValidity();

            const widthChange = sizeMeasureGroup.get('width').valueChanges.subscribe((value) => {
                let h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                let l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                let w = value;

                convertRectangleOutput(h,l,w);
            });

            dimensionChanges.push(widthChange);
        }, 100);
    }

    function subscribeForHOval(sizeMeasureGroup) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        setTimeout(() => {
            const heightChange = sizeMeasureGroup.get('height').valueChanges.subscribe((value) => {
                let h = value;
                let l = sizeMeasureGroup.value['length'] ? sizeMeasureGroup.value['length'] : 0;
                let w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                if (w && h && (w > 0 && h > 0)) {
                    if (w > h) {
                        sizeMeasureGroup.get('height').setErrors(null);
                        sizeMeasureGroup.get('width').setErrors(null);
                        convertHOvalOutput(h,l,w);
                    } else {
                        sizeMeasureGroup.get('height').setErrors({ hOvalHeightError: true });
                        sizeMeasureGroup.get('width').setErrors({ hOvalWidthError: true });
                        sizeMeasureGroup.get('width').markAsTouched({ onlySelf: true });
                        sizeMeasureGroup.get('height').markAsTouched({ onlySelf: true });
                    }
                } else if (w && h) {
                    if (w < 0) {
                        sizeMeasureGroup.get('width').setErrors({ min: true });
                    }

                    if (h < 0) {
                        sizeMeasureGroup.get('height').setErrors({ min: true });
                    }
                } else {
                    if (!w) {
                        sizeMeasureGroup.get('width').setErrors({ required: true });
                    }

                    if (!h) {
                        sizeMeasureGroup.get('height').setErrors({ required: true });
                    }
                }
            });

            dimensionChanges.push(heightChange);

            // sizeMeasureGroup.get('height').updateValueAndValidity();

            const lengthChange = sizeMeasureGroup.get('length').valueChanges.subscribe((value) => {
                let h = sizeMeasureGroup.value['height'] ? sizeMeasureGroup.value['height'] : 0;
                let l = value;
                let w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                if (w && h && (w > 0 && h > 0)) {
                    if (w > h) {
                        sizeMeasureGroup.get('height').setErrors(null);
                        sizeMeasureGroup.get('width').setErrors(null);
                        convertHOvalOutput(h,l,w);
                    } else {
                        sizeMeasureGroup.get('height').setErrors({ hOvalHeightError: true });
