const $injector = widgetContext.$scope.$injector;
const customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
const attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));

openAlarmRulesDialog();

function openAlarmRulesDialog() {
    customDialog.customDialog(htmlTemplate, AlarmRulesDialogController).subscribe();
}

function AlarmRulesDialogController(instance) {
    const vm = instance;
    const thresholdKeys = [
        'minFuelLevelThreshold',
        'minTemperatureThreshold',
        'minBatteryThreshold',
        'maxTemperatureThreshold'
    ];
    const tenantId = {
        id: widgetContext.currentUser.tenantId,
        entityType: 'TENANT'
    };

    vm.attributes = {};

    vm.alarmRulesFormGroup = vm.fb.group({
        minFuelLevelThreshold: [10, [vm.validators.required, vm.validators.min(0)]],
        minTemperatureThreshold: [0, [vm.validators.required]],
        minBatteryThreshold: [20, [vm.validators.required, vm.validators.min(0)]],
        maxTemperatureThreshold: [80, [vm.validators.required]]
    }, { validator: thresholdsValidator });

    getEntityInfo();

    vm.save = () => {
        saveAttributes().subscribe(() => {
            widgetContext.updateAliases();
            vm.dialogRef.close(null);
        });
    };

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    function getEntityInfo() {
        attributeService.getEntityAttributes(tenantId, 'SERVER_SCOPE', thresholdKeys).subscribe(
            (attrs) => {
                getEntityAttributes(attrs);
                vm.alarmRulesFormGroup.patchValue(vm.attributes);
        });
    }

    function getEntityAttributes(attributes) {
        for (let i = 0; i < attributes.length; i++) {
            vm.attributes[attributes[i].key] = attributes[i].value;
        }
    }

    function thresholdsValidator(formGroup, smthelse) {
        const min = formGroup.get('minTemperatureThreshold').value;
        const max = formGroup.get('maxTemperatureThreshold').value;

        if ((min || min === 0) && (max || max === 0)) {
            if (min >= max) {
                formGroup.get('maxTemperatureThreshold').setErrors({ dynamicMax: true });
            } else {
                formGroup.get('maxTemperatureThreshold').setErrors(null);
            }
        }

        return null;
    }

    function saveAttributes() {
        const attributes = vm.alarmRulesFormGroup.value;
        const attributesArray = [];
        for (let key in attributes) {
            if (attributes[key] !== vm.attributes[key]) {
                attributesArray.push({key: key, value: attributes[key]});
            }
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(tenantId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }
}

