const $injector = widgetContext.$scope.$injector;
const dialogs = $injector.get(widgetContext.servicesMap.get('dialogs'));
const alarmService = $injector.get(widgetContext.servicesMap.get('alarmService'));

openDeleteEntityDialog();

function openDeleteEntityDialog() {
    const alarmType = additionalParams.alarm.type ? additionalParams.alarm.type : '';
    const title = 'Clear ' + alarmType + ' Alarm';
    const content = 'Are you sure you want to clear Alarm?';
    dialogs.confirm(title, content, 'No', 'Yes').subscribe(
        (result) => {
            if (result) {
                clearAlarm();
            }
        }
    );
}

function clearAlarm() {
    alarmService.clearAlarm(additionalParams.alarm.id.id).subscribe(
        () => {
            setTimeout(() => {
                widgetContext.updateAliases();
            }, 500);
        },
        () => {
            showErrorDialog();
        }
    );
}

function showErrorDialog() {
    const title = 'Error';
    const content = 'An error occurred while clearing the alarm. Please try again.';
    dialogs.alert(title, content, 'CLOSE').subscribe();
}

