settings.markerImageFunction:
let image = images[0];
if (data) {
    const isActive = data.active && data.active !== 'false';
    const fuelLevel = data.fuelLevel;
    const batteryLevel = data.battery;
    const tankCapacity = data.tankCapacity;
    const temperature = data.temperature;
    const lowFuelLevel = data.isLowFuel;
    const lowBattery = data.isLowBattery;
    const thresholdTemperature = data.isHighTemperature || data.isLowTemperature;

    if (!isActive) {
        image = images[3];
    } else if (lowFuelLevel || thresholdTemperature) {
        image = images[1];
    } else if (lowBattery) {
        image = images[2];
    }
}

return {
    url: image,
    size: 28
};

settings.clusterMarkerFunction:
if (data && data.length && childCount === data.length) {
   const alarmsState = data.map((entity) => {
        if (entity) {
            const isActive = entity.active && entity.active !== 'false';
            const fuelLevel = entity.fuelLevel;
            const batteryLevel = entity.battery;
            const tankCapacity = entity.tankCapacity;
            const temperature = entity.temperature;
            const lowFuelLevel = entity.isLowFuel;
            const lowBattery = entity.isLowBattery;
            const thresholdTemperature = entity.isHighTemperature || entity.isLowTemperature;
            const isAlarm = lowFuelLevel || lowBattery || thresholdTemperature || !isActive;

            return isAlarm;
        }

        return false;
    });

    return alarmsState.includes(true) ? '#ff0000' : '#73c65e'; 
}

return '#73c65e';

