    vm.showDimensions = function(dimensionsString) {
        const currentShape = vm.editEntityFormGroup.get('details').get('tankShape').value;
        switch (dimensionsString) {
            case "L_D": 
                return currentShape === vm.tankShapes.hCylinder ||
                       currentShape === vm.tankShapes.vCapsule || 
                       currentShape === vm.tankShapes.hCapsule || 
                       currentShape === vm.tankShapes.hElliptical;

            case "H_D": 
