    function getEntityInfo() {
        widgetContext.rxjs.forkJoin([
            attributeService.getEntityAttributes(entityId, 'SERVER_SCOPE'),
            entityService.getEntity(entityId.entityType, entityId.id)
        ]).subscribe(
            function (data) {
                getEntityAttributes(data[0]);
                vm.entity = data[1];
                onLevelMeasurementChange(vm.attributes.levelMeasurement);
                vm.editEntityFormGroup.patchValue({
                    general: {
                        entityName: vm.entity.name,
                        entityLabel: vm.entity.label,
                    },
                    details: vm.attributes
                }, {emitEvent: false});

                const details = vm.editEntityFormGroup.get('details').value;
                if (details.tankMeasurementSystem === vm.measurementSystems.imperial) {
                    vm.dimensionUnits = imperial.dimension;
                    vm.capacityOutputs = imperial.output;
                } else {
                    vm.dimensionUnits = metric.dimension;
                    vm.capacityOutputs = metric.output;
                }

                if (details.sensorMeasurementSystem === vm.measurementSystems.imperial) {
                    vm.readingUnits = imperial.dimension;
                } else {
                    vm.readingUnits = metric.dimension;
                }

                vm.units = vm.editEntityFormGroup.get('details').get('tankDimensionUnits').value;
                setSizeMeasureFields(vm.attributes.tankShape);
                vm.tankImage = tankImagesMap[vm.attributes.tankShape];
                subscribeForControlsChanges();
            }
        );
    }

