                let w = sizeMeasureGroup.value['width'] ? sizeMeasureGroup.value['width'] : 0;

                if (w && h && (w > 0 && h > 0)) {
                    if (w > h) {
                        sizeMeasureGroup.get('height').setErrors(null);
                        sizeMeasureGroup.get('width').setErrors(null);
                        convertHOvalOutput(h,l,w);
                    } else {
                        sizeMeasureGroup.get('height').setErrors({ hOvalHeightError: true });
                        sizeMeasureGroup.get('width').setErrors({ hOvalWidthError: true });
                        sizeMeasureGroup.get('width').markAsTouched({ onlySelf: true });
                        sizeMeasureGroup.get('height').markAsTouched({ onlySelf: true });
                    }
                } else if (w && h) {
                    if (w < 0) {
                        sizeMeasureGroup.get('width').setErrors({ min: true });
                    }

                    if (h < 0) {
                        sizeMeasureGroup.get('height').setErrors({ min: true });
                    }
