    function subscribeForHElliptical(sizeMeasureGroup) {
        const tankCapacityControl = vm.editEntityFormGroup.get('details').get('tankCapacity');
        setTimeout(() => {
            const lengthChange = sizeMeasureGroup.get('length').valueChanges.subscribe((value) => {
                let l = value;
